import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { useEffect, useState } from 'react';

import LoginPage from './pages/LoginPage';
import HomePage from './pages/HomePage';
import ProfilesPage from './pages/ProfilePage';
import TeamPage from './pages/TeamPage';
import TeamsWithProposalPage from './pages/TeamsWithProposalPage';
import RegisterPage from './pages/RegisterPage';
import IntroPage from './pages/IntroPage/IntroPage';
import ProtectedRoute from './ProtectedRoutes';

function App() {
  const [userEmail, setUserEmail] = useState(null);

  useEffect(() => {
    const email = localStorage.getItem('userEmail');
    if (email) {
      setUserEmail(email);
    }
  }, []);

  return (
    <Router>
      <Routes>
        <Route path="/" element={userEmail ? <IntroPage /> : <LoginPage />} />
        <Route path="/register" element={<RegisterPage />} />
        <Route path="/login" element={<LoginPage />} />
        <Route path="/homepage" element={<ProtectedRoute element={<HomePage />} />} />
        <Route path="/profiles" element={<ProtectedRoute element={<ProfilesPage />} />} />
        <Route path="/teams" element={<ProtectedRoute element={<TeamPage />} />} />
        <Route path="/room/:roomId" element={<ProtectedRoute element={<RoomPage />} />} />
        <Route
          path="/teamswithproposal"
          element={<ProtectedRoute element={<TeamsWithProposalPage />} />}
        />
      </Routes>
    </Router>
  );
}

export default App;
